import React, { useEffect, useState } from'react'
import {useNavigate} from 'react-router-dom'
import axios from 'axios'
import "../css/style.css"
function Home(){
  const navigate=useNavigate()
  const [post,setpost]=useState([])
  const onSubmit=async(req,res)=>{
    try {
      await axios.get("/api/v1/users/logout")
      navigate("/api/v1/users/login")
    } catch (error) {
     console.log(error);
    }
 }
  useEffect(()=>{
    const fetchPosts=async()=>{
try {
        const response=await axios.get('/api/v1/users/home')
    setpost(response.data)
} catch (error) {
  console.log(error);

}    }
fetchPosts()
  })
  const navi=()=>{
    navigate('/api/v1/post/Cpost')
  }
    return(
<div className="background-image">
<nav>
  <div id='ga'>
    <span className='gap'id='aa' >Home</span>
    <span className='gap' onClick={navi}>Create Post</span>
    <span className='gap' >My Posts</span>
    <span className='gap' >Profile</span>
    <span className='gap' onClick={onSubmit}>Logout</span>
  </div>
</nav>
<div>
  {post && Array.isArray(post) && post.length>0?(
    post.map((i)=>(
      <div key={i._id}>
        <h2>{post.title}</h2>
        <p>{post.excerpt}</p>
      <p>By {post.author} on {new Date(post.date).toLocaleDateString()}</p>
      </div>
    ))):(<P>No post Available</P>)
  }
</div>
</div>)
}
export default Home
